import './style.css';
import gitHub from './gitHub-black.svg';

const ButtonGitHub = (link) => {
    return (
        <a href={link} className="btn-outline">
            <img src={gitHub} alt="" />
            GitHub repo
        </a>
    );
}
 
export default ButtonGitHub;
